import Contact from "./components/Contact";
import Footer from "./components/Footer";
import useSmoothScroll from "./utils/scroll";  // ðŸ‘ˆ import hook
import "./App.css";

export default function App() {
  return (
    <div className="app">
      <Header />

      <main>
        <section id="home">
          <Home />
        </section>
        <section id="about">
          <About />
        </section>
        <section id="projects">
          <Projects />
        </section>
        <section id="contact">
          <Contact />
        </section>
      </main>

      <Footer />
    </div>
  );
}
